const Navbar = () => { 
  
  return (
    <>
    <header>
      <nav className='navbar-main'>
      <div className="navbar">
        <div className="container">
        <div className="logo">
          <img className='image' src='https://cdn.worldvectorlogo.com/logos/react-1.svg' alt=''/>
