          <li><a href={"/Events"}>Events</a></li>
          </ul>   
          <a href="/" className="search-btn"> <i className="fa-solid fa-magnifying-glass"></i></a> 
          <div className="toggle_btn">
          <i className="fa-solid fa-bars"></i>
