      </div>
      </div>
      <div className="dropdown_menu ">
      <ul className="links ms">
          <li><a href="/">Home</a></li>
          <li><a href="/">About</a></li>
          <li><a href="/">Events</a></li>
          </ul> 
          <a href="/" className="search-btn"> <i className="fa-solid fa-magnifying-glass"></i> </a>  

      </div>
      </nav>
    </header>
    </>
      
  )  
  
}


export default Navbar
